import React from "react";
import Navbar from "../components/navbar";
import '../assets/CSS/home.css'
import brain1 from '../assets/images/brain2.png'
import Particels from 'react-particles-js'

function Home(){
    return(
        <div>
            <Particels
            params={{
                particles: {
                    number: {
                      value: 80,
                      density: {
                        enable: true,
                        value_area: 800
                      }
                    },
                    color: {
                      value: "#000000"
                    },
                    "shape": {
                      "type": "circle",
                      "stroke": {
                        "width": 0,
                        "color": "#000000"
                      },
                      "polygon": {
                        "nb_sides": 6
                      },
                      "image": {
                        "src": "img/github.svg",
                        "width": 100,
                        "height": 100
                      }
                    },
                    "opacity": {
                      "value": 0.19240944730386272,
                      "random": true,
                      "anim": {
                        "enable": false,
                        "speed": 1.1368434728944043,
                        "opacity_min": 0.3978952155130415,
                        "sync": true
                      }
                    },
                    "size": {
                      "value": 8,
                      "random": false,
                      "anim": {
                        "enable": false,
                        "speed": 40,
                        "size_min": 0.1,
                        "sync": false
                      }
                    },
                    "line_linked": {
                      "enable": true,
                      "distance": 150,
                      "color": "#2f3637",
                      "opacity": 1,
                      "width": 1
                    },
                    "move": {
                      "enable": true,
                      "speed": 6,
                      "direction": "none",
                      "random": false,
                      "straight": false,
                      "out_mode": "out",
                      "bounce": false,
                      "attract": {
                        "enable": false,
                        "rotateX": 600,
                        "rotateY": 1200
                      }
                    }
                  },
                  "interactivity": {
                    "detect_on": "canvas",
                    "events": {
                      "onhover": {
                        "enable": true,
                        "mode": "repulse"
                      },
                      "onclick": {
                        "enable": true,
                        "mode": "push"
                      },
                      "resize": true
                    },
                    "modes": {
                      "grab": {
                        "distance": 182.70698671517212,
                        "line_linked": {
                          "opacity": 1
                        }
                      },
                      "bubble": {
                        "distance": 170.52652093416066,
                        "size": 24.360931562022948,
                        "duration": 1.1368434728944043,
                        "opacity": 0.3004514892649497,
                        "speed": 3
                      },
                      "repulse": {
                        "distance": 95,
                        "duration": 0.4
                      },
                      "push": {
                        "particles_nb": 4
                      },
                      "remove": {
                        "particles_nb": 2
                      }
                    }
                  },
                  "retina_detect": true
                }
            }/>
            <Navbar/>
            <div className="under-nav">
            <div className="animation-hold"></div>
            <div className="inroduction"></div>
            </div>
            <div className="under-nav2">
                <div className="brain-hold">
                </div>
            </div>
        </div>
    )
}

export default Home
